function AStar(map){
    let startPoint = null;
    let walls = [];
    let endPoints = [];

    map.map((square) => {
        if(square.val && square.type ===  "start"){
            // console.log(square);
            startPoint = square;

            return null;
        }

        if(square.val && square.type === "wall"){
            // console.log(square);
            endPoints.push(square);

            return null;
        }

        if(square.val && square.type === "end"){
            console.log(square);
            endPoints.push(square);

            return null;
        }

        return null;
    })

    console.log(startPoint, endPoints);
}

export default AStar
